import * as React from 'react';
import Alert from '@mui/material/Alert';
import Stack from '@mui/material/Stack';

export default function BasicAlerts() {
    return (
      <Stack sx={{ width: '100%' }} spacing={2}>
        <Alert severity="success">Votre recette a été crée avec succès.</Alert>
        <Alert severity="info">Votre recette a été modifié.</Alert>
        <Alert severity="warning">Votre recette n'a pas été sauvegardé.</Alert>
        <Alert severity="error"> Votre recette contient une erreur.</Alert>
      </Stack>
    );
  }
